import React from "react";
import { Route } from "react-router-dom";
import Nav from "./Nav";
import SubNav from "./SubNav";

function NavWrapper(props) {
  console.log(Object.keys(props.navInfo));
  return (
    <>
      <nav>
        {!props.navInfo ? (
          <div>Loading...</div>
        ) : (
          Object.keys(props.navInfo).map(value => <Nav navInfo={value} />)
        )}
      </nav>
      <Route path="/mac/" render={props => <SubNav />} />
    </>
  );
}

export default NavWrapper;
